        { id: '2', title: 'Second item' },
        { id: '3', title: 'Third item' },
        { id: '4', title: 'Fourth item' }
    ];
    return (

            <Row size={10}>
                <View style={styles.container}>
                    <Text style={styles.text}>Basic FlatList Example</Text>
